Collection of the Common Customs Tariff duties applicable to imports of the products described below are hereby suspended from 1 January until 31 October 1992:
ex 2309 90 31 Mixtures of residues from the maize starch industry and of residues from the extraction of maize germ oil obtained by wet milling having by weight on the dry product:
- a protein content less than or equal to 40 %;
- a fat content (calculated in accordance with method A indicated in Annex I to Commission Directive 84/4/EEC) (1) less than or equal to 4,5 %;
ex 2309 90 41 Mixtures of residues from the maize starch industry and of residues from the extraction of maize germ oil obtained by wet milling having by weight on the dry product:
- a starch content less than or equal to 28 %;
- a protein content less than or equal to 40 %;
- a fat content (calculated in accordance with method A indicated in Annex I to Commission Directive 84/4/EEC) less than or equal to 4,5 %.
